import React, { Component } from "react";
import Timer from "./Timer";

export default class WorkoutPage extends Component {
    constructor(props) {
        super(props);
        this.state = {          
          selectedWorkouts: [],
        };
      }
    

    render() {
        return(
            <div className="container-fluid">
                <div className="row">
                    <Timer />
                </div>
                <div className="row justify-content-center">
                    <div className="col-lg-5">

                    </div>
                </div>

            </div>
        )
    }
    
}
